CREATE DEFINER=`root`@`localhost` PROCEDURE `update_budget` (IN `in_mda_name` VARCHAR(20), IN `in_mda_parent_code` VARCHAR(20), IN `in_mda_child_code` VARCHAR(20), IN `in_description` VARCHAR(20), IN `in_amount` FLOAT(10), IN `in_remarks` VARCHAR(20), IN `in_query_type` VARCHAR(50), IN `in_id` VARCHAR(400), IN `in_post_budget_amount` VARCHAR(400), IN `in_Proposed_budget` FLOAT(10), IN `in_Approved_budget` FLOAT(10), IN `in_revised_budget` FLOAT(10), IN `in_buget_code` VARCHAR(60), IN `in_buget_year` VARCHAR(5), IN `in_segment_code` VARCHAR(50), IN `in_admin_code` VARCHAR(50), IN `in_functional_code` VARCHAR(50), IN `in_fund_code` VARCHAR(50), IN `in_geo_code` VARCHAR(50))  NO SQL
BEGIN

declare new_Proposed_budget, Proposed_budget1, new_Approved_budget,Approved_budget1, new_revised_budget,revised_budget1 float;

IF in_query_type ='INSERT' THEN

select Proposed_budget,	Approved_budget,	revised_budget into Proposed_budget1,	Approved_budget1,	revised_budget1 from update_budget
where mda_parent_code=in_mda_parent_code and buget_code=in_buget_code and buget_year=in_buget_year ;

if Proposed_budget1 is null and	Approved_budget1 is null and	revised_budget1 is null then

	Proposed_budget,	Approved_budget,	revised_budget,	buget_code,	buget_year,	id, segment_code, admin_code, functional_code, fund_code, geo_code) 
VALUES(in_mda_name,	in_mda_parent_code,	in_mda_child_code,	in_description,	in_amount,	in_remarks,
	in_Proposed_budget,	in_Approved_budget,	in_revised_budget,	in_buget_code,	in_buget_year,id, in_segment_code, in_admin_code, in_functional_code, in_fund_code, in_geo_code);

values(now(),in_mda_parent_code,in_Approved_budget,0,in_buget_code,	in_buget_year);


else 

set new_Proposed_budget = Proposed_budget1+in_Proposed_budget, new_Approved_budget=Approved_budget1+in_Approved_budget,
 new_revised_budget=revised_budget1+in_revised_budget;

update update_budget set Proposed_budget=new_Proposed_budget,	Approved_budget=new_Approved_budget,	revised_budget=new_revised_budget 
where mda_parent_code=in_mda_parent_code and buget_code=in_buget_code and buget_year=in_buget_year ;

values(now(),in_mda_parent_code,in_Approved_budget,0,in_buget_code,	in_buget_year);



end if;

ELSEIF in_query_type ='UPDATE' THEN
UPDATE update_budget SET mda_name=in_mda_name,mda_parent_code=in_mda_parent_code,
description=in_description,amount=in_amount + in_post_budget_amount,remarks=in_remarks WHERE mda_child_code=in_mda_child_code;

ELSEIF in_query_type ='DELETE' THEN
DELETE FROM update_budget WHERE in_mda_child_code=mda_child_code;

ELSEIF in_query_type = "select_all_child_code1" THEN
SELECT * FROM update_budget; 

ELSEIF in_query_type = "tree" THEN
SELECT  mda_parent_code as  subhead, mda_child_code as  title, description, amount, id from update_budget;

ELSEIF in_query_type = "select_by_tree" THEN
SELECT MAX(mda_child_code) + 1 as child_code FROM update_budget WHERE mda_parent_code = in_mda_parent_code;

ELSEIF in_query_type = "select_all_child_code" THEN 
SELECT mda_child_code, description, amount, mda_parent_code,  concat (description, "(", mda_child_code, ")") as budget FROM update_budget;

END IF; 
END$$

